    Command: '/waymark',
    ShortCommand: '/wmark',
    Description:
      "ALIASES:\n　/waymark, /wmark\nUSAGE:\n　/wmark [subcommand] [placeholder]\n\n→Place a waymark on the ground below a target. If no target is specified, you will enter ground targeting mode ready to place a waymark.\n\n>>Subcommands:\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>a <UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Place or remove waymark A. Overwrites existing waymark if target is specified.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>b <UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Place or remove waymark B. Overwrites existing waymark if target is specified.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>c <UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Place or remove waymark C. Overwrites existing waymark if target is specified.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>d<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Place or remove waymark D. Overwrites existing waymark if target is specified.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>1<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Place or remove waymark 1. Overwrites existing waymark if target is specified.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>2<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Place or remove waymark 2. Overwrites existing waymark if target is specified.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>3<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Place or remove waymark 3. Overwrites existing waymark if target is specified.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>4<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Place or remove waymark 4. Overwrites existing waymark if target is specified.\n 　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow> off<UIGlow>01</UIGlow><UIForeground>01</UIForeground>/<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>clear <UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Remove all waymarks.\n 　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>save 1-5<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Save waymark placements to slots 1-5 of the Waymarks menu.\n　 <UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>preset 1-5<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Load waymark placements from slots 1-5 of the Waymarks menu.\n\nYou will enter ground targeting mode ready to place an unused waymark in the order of A-D, 1, 2 when no subcommand is specified. More than six waymarks cannot be placed at one time. If a target name is specified, a marker name must also be specified.\n\n>>Common Placeholders:\n　<t>, <target>, <1>-<8>\n\nA full list of placeholders can be found on the Lodestone Play Guide.\n\n>>Examples:\n　/waymark A\n　(Enters ground targeting\n　mode ready to place\n　waymark A.)\n\n　/waymark A <t>\n　(Places waymark A at the\n　selected target's location.)",
    Alias: '/waymark',
    ShortAlias: '/wmark',
    Param: 32,
    __5: 0,
