    Description:
      'ALIASES:\n　/gearset, /gs\nUSAGE:\n　/gearset [subcommand]\n\n→Execute gear set functions.\n\n>>Subcommands:\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>change [number 1] [number 2] <UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Equip gear in slot [number].\n　　A gear set name can be\n　　specified in place of a slot\n　　number. If glamour plates\n　　are available, a plate\n　　number can also be\n　　specified.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>view [number] <UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　List gear in slot [number].\n　　A gear set name can be\n　　specified in place of a slot\n　　number.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>save [number] <UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Save current gear to slot\n　　[number]. A gear set name\n　　can be specified in place\n　　of a slot number.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>delete [number] <UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Delete slot [number]. A\n　　gear set name can be\n　　specified in place of a slot\n　　number.\n\nFirst letter matching can be used when specifying gear sets by name.\nGear sets will be searched in order from lowest slot number to highest.\nGear set list will be displayed when no subcommand is specified.\n\n>>Example:\n　/gearset change 1 1\n　(Equip gear in slot 1 and\n　cast glamour from plate 1.)\n　/gearset change warrior\n　(Equip gear slot whose\n　name begins with warrior.)',
