    Description:
      'USAGE:\n　/pvphotbar [subcommand]\n\n→Edit and configure hotbar settings. This command can only be used with the PvP hotbar.\n\n>>Subcommands\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>action "action name" [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Set the specified PvP action to slot [#2] in hotbar page [#1]. If "current" is entered for [#1], then the action will be set in the page displayed in hotbar 1. If [#2] is omitted, the action will be set to the lowest-numbered slot available. If both [#1] and [#2] are omitted, the action will be set to the lowest-numbered slot available on the lowest-numbered hotbar available. This applies to all of the following subcommands.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>general "general action name" [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Set the specified general action to slot [#2] in hotbar [#1].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>item "item name" [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Set the specified item to slot [#2] in hotbar [#1].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>emote "emote name" [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Set the specified emote to slot [#2] in hotbar [#1].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>companion "companion action name" [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Set the specified companion action to slot [#2] in hotbar [#1].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>pet "action name" [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Set the specified pet action to slot [#2] in hotbar [#1].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>minion "minion name" [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Set the specified minion to slot [#2] in hotbar [#1].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>mount "mount name" [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Set the specified mount to slot [#2] in hotbar [#1].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>enemysign "enemy sign name" [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Set the specified enemy sign to slot [#2] in hotbar [#1].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>waymark "waymark name" [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Set the specified waymark to slot [#2] in hotbar [#1].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>change [number]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Replace current hotbar with hotbar [number].  If "next" or "prev" is entered in [number], then you can scroll through the pages of hotbar 1.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>copy [job 1] [#1] [job 2] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Copy the contents of [job 1] hotbar [#1] to the [job 2] hotbar [#2].\n　　The subcommand "current" can be used to specify your current job.\n　　The subcommand "share" can be used instead of a job to specify your shared hotbar.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>display [number] on<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Display hotbar [number].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>display [number] off<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Hide hotbar [number].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>display [number]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Toggle on/off hotbar [number].\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>share [number] on<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Make hotbar [number] shared.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>share [number] off<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Unshare hotbar [number] and assign it to your current job.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>share [number]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Toggle between on/off.\n　<UIForeground>F201FA</UIForeground><UIGlow>F201FB</UIGlow>remove [#1] [#2]<UIGlow>01</UIGlow><UIForeground>01</UIForeground>\n　　Remove the action assigned to slot [#2] on hotbar [#1].\n　　Replace [#2] with "all" to remove all actions from hotbar [#1].\n\n>>Examples:\n　/pvphotbar action "Purify" 1 1\n　(Places Purify in slot [#1]\n　on hotbar [#1].)\n\n　/pvphotbar change 2\n　(Replaces PvP hotbar [#1]\n　with PvP hotbar [#2].)',
